

INPUT = ""

SIZE = 5

def parcer_input(input):
    GROUPS = []
    
    index = 0 
    size = SIZE
    while size <= len(input):
        
        GROUPS.append(input[index:size])
        
        index = size
        size += SIZE
    
    return GROUPS


def check_groups():
    groups = parcer_input(INPUT)
    valid_group = []
    
    for group in groups:
        if len(group) == 5 and 'p' in group and 'c' in group and 'm' in group and 'b' in group and 'z' in group:
            
            valid_group.append(group)

    return valid_group
    
    
print(len(check_groups()))